import React from 'react';
import './App.css';
import {Map} from './01/Map';
import {Button} from './01/components/Button';

function App() {
    const topCars = [
        {manufacturer: 'BMW', model: 'm5cs'},
        {manufacturer: 'Mercedes', model: 'e63s'},
        {manufacturer: 'Audi', model: 'rs6'}
    ]

    const onClickHandler = (name: string) => {
        console.log(name)
    }
    return (
        <>
            <Map topCars={topCars}/>
            <Button onClick={()=> onClickHandler('Vasya')} name='My Youtube Channel - 2'/>
        </>
    );
}

export default App;
